offers.description:
BMW i3 REX, без пробега по РФ, рестайлинговая, с увеличенной батареей (при полной зарядке батареи запас хода составляет - 250-300 км.) и бензиновым двухцилиндровым генератором Range Extender, объёма 0,65 литра и мощностью 38 л.с… (С этим полезным довеском запас хода увеличивается на 150 км). Растаможен и поставлен на учёт как электромобиль!!! Машина на ЗИМНЕЙ резине (родная летняя в комплекте). 
Комплектация:
-keylessgo (безключевой доступ и запуск);
-панорамная крыша;
-большой экран;
-мультимедиа с поддержкой всех доступных функций, в том числе и AppleCarPlay;
-светодиодные фары;
-круиз-контроль+дистроник;
-камера заднего вида.
Дата производства - декабрь 2017 г., начало эксплуатации - апрель 2018 г.
